import './style.css';

class Navbar extends Component {
  render() {
    return(
      <div>
          <nav>
              <ul>
                <div className="container">
                  <div className="row">

                    <div className="col d-flex">
                      <li><a href="index.html"><img className="nav-dim" src="./img/logo.png" alt="Animal Forest logo"/></a></li>
                    </div>

                    <div class="col-6 d-flex"></div>
                        <div class="col d-flex pt-2">
                            <li><a href="index.html" aria-label="Home page">Home</a></li>
                            <li><a href="About.html" aria-label="About page">About</a></li>
                        </div> 
                  </div>
                </div>
              </ul>
          </nav>
      </div>
    );
  }
}

class App extends Component {

  render() {
    return (
      <div>
        <header>
          <Navbar />

        </header>

        <main>


        </main>

        <footer>


        </footer>
      </div>
    );
  }

}

export default App;
